    //! @brief generate the predictions for the given INPUT vector
    //! @param INPUT Input vector that contains descriptors
    //! @return JUFO prediction for the given input
    linal::Vector< double> JUFOANN::F( const linal::Vector< double> &INPUT) const
    {

      // declare variables
      const double *nora( s_NormalizeA), *norb( s_NormalizeB), *wei;
      double *hid;
      bcl::linal::Vector< double> result( 3);

      // test net size
      BCL_Assert( INPUT.GetSize() == 1053, "wrong input size!");

      // allocate memory
      bcl::linal::Vector< double> hidden[ 3];
      hidden[0] = bcl::linal::Vector< double>( 1053);
      hidden[1] = bcl::linal::Vector< double>( 39);
      hidden[2] = bcl::linal::Vector< double>( 3);

      // normalize data
      hid = hidden[ 0].Begin();
      for( const double *inp = INPUT.Begin(); inp != INPUT.End(); inp++)
      ( *( hid++)) = ( *inp) * ( *( nora++)) + ( *( norb++));

      // calculate network
      // calculate layer 1
      wei = s_WeightsLayer0;
      hid = hidden[1].Begin();
      for( size_t i = 0; i < 39; i++)
      {
        *hid = *( wei++);
        for( const double *inp = hidden[ 0].Begin(); inp != hidden[ 0].End(); inp++)
          ( *hid) += *( wei++) * ( *inp);
        *hid = double( 1.0) / ( double( 1.0) + exp( -( ( *hid))));
        hid++;
      }

      // calculate layer 2
      wei = s_WeightsLayer1;
      hid = hidden[2].Begin();
      for( size_t i = 0; i < 3; i++)
      {
        *hid = *( wei++);
        for( const double *inp = hidden[ 1].Begin(); inp != hidden[ 1].End(); inp++)
          ( *hid) += *( wei++) * ( *inp);
        *hid = double( 1.0) / ( double( 1.0) + exp( -( ( *hid))));
        hid++;
      }

      // denormalize data
      hid = result.Begin();
      for( const double *inp = hidden[ 2].Begin(); inp != hidden[ 2].End(); inp++)
        ( *( hid++)) = ( *inp) * ( *( nora++)) + ( *( norb++));

      // end
      return result;

    }

